// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.5.0 < 0.9.0;

contract DynArr {

    uint[] public arr = [1,2,3];

    function set_element(uint index, uint element) public {
        arr[index] = element;
    }

    function length() public view returns(uint) {
        return arr.length;
    }

    

}
